import React, { useState } from "react";
import "./side-notation.css";

function SideNotation() {
  function build_notation() {
    const side_container = [];
    for (var i = 8; i >= 1; i--) {
      side_container.push(`<div class="side-notation">${i}</div>`);
    }
  }

  return (
    <div className="side-notation">
      <div class="side-notation">1</div>
    </div>
  );
}

export default SideNotation;
